import Sign from './Sign';
function Login() {
    return (
        <Sign
        title='Вход'
        textButton='Войти'
        >
            <input className="popup__input popup__input_type_name" id="email-input" type="email" name="email" placeholder="E-mail"/>
            <span className="email-input-error"/>
            <input className="popup__input popup__input_type_password" id="password-input" type="password" name="password" placeholder="Пароль"/>
            <span className="password-input-error"/>
        </Sign>
    )
}
export default Login
